/* Adding apps/drive7/drive7/drive7/doctype/main_page_content/main_page_content.js */

frappe.ui.form.on('Main Page Content', {
    refresh: function(frm) {
        // Check the current status of the document and decide whether to show or hide the Sync button
        if (frm.doc.status !== 'In Process') {
            // If status is not 'In Process', show the button
            var btn = frm.add_custom_button('Sync', function() {
                // Ask for confirmation before starting the sync operation
                frappe.confirm(
                    __('Are you sure you want to start the sync operation?'), // Confirmation message
                    function() {
                        // User confirmed the action
                        frappe.msgprint(__('Sync operation is starting...'));

                        // Call the perform_request method
                        frappe.call({
                            method: 'handle_stream',
                            doc: frm.doc,
                            callback: function(r) {
                                if (r.exc) {
                                    // Handle error
                                    frappe.msgprint(__('There was an error processing your request.'));
                                } else {
                                    // Optionally refresh the document or show a message
                                    frm.reload_doc();
                                }
                            }
                        });
                    },
                    function() {
                        // User canceled the action
                        frappe.msgprint(__('Sync operation cancelled.'));
                    }
                );
            });

            // Dynamically change the button label or disable it based on status
            if (frm.doc.status === 'In Process') {
                // Disable the Sync button if status is 'In Process'
                btn.toggle(false);
            } else {
                // Enable the Sync button otherwise
                btn.toggle(true);
            }
        }
    }
});


